import React from 'react';
import './App.css';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import Nav from './Nav'
import Home from './Home'
import Page_Principale from './Components/Page_Principale'
import Page_Admin from './Components/Page_Admin'
function App(){
  return(
    <Router>
      <div>
        <Nav></Nav>
        <Switch>
          <Route path="/Home" exact component={Home}></Route>
        <Route path="/Page_Admin" component={Page_Admin}></Route>        
        <Route path="/Page_Principale" component={Page_Principale}></Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
